import axios from "axios";
import { useState } from "react";

interface User {
	id: number,
	email: string,
	firstName?: string,
	lastName?: string,
	userName?: string,
}

async function GetAllUsers(): promise<User[]> {

	const users: Array<User> = [];

	axios.get('http://localhost:3001/user')
	.then(response => {
		response.data.forEach((element: User) => {
			users.push(element);
		});
	});
	return users;
}

const App:React.FC = () =>
{
	const users: User[] = GetAllUsers();
	console.log(users);

	return (
		<div> 
			<h1>These are all the Users!</h1>
			<ul>
				<li>test</li>
				{users.map(function(element) {
					return (<li>{element.id}</li>);
				})}
			</ul>



				{/* {!users ? <p>no users</p> : <p>there are users</p>} */}
		</div>
		);
}

export default App;
